import React from "react";
import "./ShoppingItem.css";

export default function ShoppingItem(props) {
  return (
    <React.Fragment>
      <div className="shopping-item">
        <h2>Photo title: {props.title}</h2>
        <p>Price: {props.price}</p>
      </div>
    </React.Fragment>
  );
}
